import React from 'react';

import { Container, InputContainer, Title, InputMaskCustom } from './styled';

const InputMask: React.FC = () => {
  return (
    <Container>
      <Title>Phone</Title>
      <InputContainer>
        <InputMaskCustom mask="+999 999 999 999" maskPlaceholder="" />
      </InputContainer>
    </Container>
  );
};

export default InputMask;
